import React, { useEffect } from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

import logo from '../img/logo.png'
import Blog from '../pages/BlogPage'
import News from '../pages/News'
import About from '../pages/About'
import Contacts from '../pages/Contacts'

import '../CSS/Header.css'

function Header() {
	useEffect(() => {
		const select = document.querySelector('select')
		const allLang = ['en', 'ru']

		select.addEventListener('change', changeURLLanguage)

		function changeURLLanguage() {
			let lang = select.value
			window.location.href = window.location.pathname + '#' + lang
			window.location.reload()
			changeLanguage() // Добавьте эту строку для вызова функции changeLanguage после перезагрузки страницы
		}

		function changeLanguage() {
			let hash = window.location.hash
			hash = hash.substring(1)
			console.log(hash)
			if (!allLang.includes(hash)) {
				window.location.href = window.location.pathname + '#ru'
				window.location.reload()
			}
			const lang = {
				home: {
					ru: 'Главная',
					en: 'Home',
				},
				blog: {
					ru: 'Блог',
					en: 'Blog',
				},
				about: {
					ru: 'Обо мне',
					en: 'About',
				},
				contacts: {
					ru: 'Контакты',
					en: 'Contacts',
				},
				news: {
					ru: 'Новости',
					en: 'News',
				},
				site: {
					ru: 'Сайта',
					en: 'Site',
				},
				me: {
					ru: 'Мои',
					en: 'Me',
				},
				path: {
					ru: 'Мой путь в IT',
					en: 'My path to IT',
				},
				about_me: {
					ru: 'Я Кузьма, мне 15 лет. <br> Начинающий Front-end разработчик. Увлекаюсь веб-программированием около года.',
					en: 'Im Kuzma, me 15 years old. <br> Beginner Front-end developer. I have been interested in web programming for about a year.',
				},
				programming_languages: {
					ru: 'Языки программирования: HTML, CSS, JavaScript, PHP',
					en: 'Programming languages: HTML, CSS, JavaScript, PHP.',
				},
				technologies: {
					ru: 'Технологии: MySQL, Git, AJAX, React, React-router',
					en: 'Technologies: MySQL, Git, AJAX, React, React-router',
				},
				feedback: {
					ru: 'Обратная связь',
					en: 'Feedback',
				},
				groups: {
					ru: 'Мои группы',
					en: 'My groups',
				},
				portfolio: {
					ru: 'Мое портфолио',
					en: 'My portfolio',
				},
				personal_contacts: {
					ru: 'Личные ',
					en: 'Personal ',
				},
				groups_contacts: {
					ru: 'Группы ',
					en: 'Groups ',
				},
				subscribers: {
					ru: 'Подписчиков',
					en: 'Subscribers ',
				},
			}

			select.value = hash
			document.querySelector('title').innerHTML = lang['home'][hash]
		}

		changeLanguage() // Call the function to check the initial language on page load
	})

	return (
		<>
			<header className='Header'>
				<a href='/'>
					<img src={logo} alt='Главная' className='Header__logo' />
				</a>

				<nav className='Header__nav'>
					<a href='/' className='Header__link'>
						Главная
					</a>
					<a href='/blog' className='Header__link'>
						Блог
					</a>
					<a href='/about' className='Header__link'>
						Обо мне
					</a>
					<a href='/contacts' className='Header__link'>
						Контакты
					</a>
				</nav>
				<select className='Header__lang' defaultValue='ru'>
					<option value='ru'>RU</option>
					<option value='en'>EN</option>
				</select>
			</header>
			<Router>
				<Routes>
					<Route exact path='/' element={<News />} />
					<Route exact path='/blog' element={<Blog />} />
					<Route exact path='/about' element={<About />} />
					<Route exact path='/contacts' element={<Contacts />} />
				</Routes>
			</Router>
		</>
	)
}

export default Header
